export function result(result){
    return{
        type:"ADD_NUMBERS",
        payload:result
    };
}

export function multiplyNumbers(n1,n2){
    return{
        type:"MULTIPLY_NUMBERS",
        payload:`Multiplicacion: ${n1} * ${n2} = ${n1*n2}`
    };
}
